CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_flightSeats`()
BEGIN
	SELECT flight.FLY_ID, (AMOD_FIRST + AMOD_ECONPLUS + AMOD_BUSINESS + AMOD_ECON) AS 'TOTAL_SEATS',
		(SELECT COUNT(BOOK_SEATNUM) FROM booking WHERE BOOK_FLY_ID = flight.FLY_ID) AS 'BOOKED_SEATS',
        (AMOD_FIRST + AMOD_ECONPLUS + AMOD_BUSINESS + AMOD_ECON) - 
        (SELECT COUNT(BOOK_SEATNUM) FROM booking WHERE BOOK_FLY_ID = flight.FLY_ID) AS 'EMPTY_SEATS'
	FROM (flight
	INNER JOIN aircraft ON flight.AIRCRAFT_AIRCRAFT_ID = aircraft.AIRCRAFT_ID
	INNER JOIN aircraft_model ON aircraft.AMOD_ID = aircraft_model.AMOD_ID)
	ORDER BY flight.FLY_ID;
END ;;
