CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_updateContact`(employeeID int UNSIGNED, lastName varchar(45), firstName varchar(45), initial char(1), phoneNumber varchar(15))
BEGIN
	DECLARE completed int default 0;
	DECLARE ContactEmpID int UNSIGNED default 0;
    DECLARE myCursor CURSOR FOR SELECT EMCT_EMP_ID FROM emergency_contact LIMIT 1;
    DECLARE CONTINUE HANDLER FOR NOT FOUND SET completed = 1;
    OPEN myCursor;
		get_contact: LOOP
			FETCH myCursor INTO ContactEmpID;
            IF completed = 1 THEN
				LEAVE get_contact;
			ELSEIF ContactEmpID = employeeID THEN
				UPDATE g3ds.emergency_contact
				SET EMCT_LNAME = lastName, 
                EMCT_FNAME = firstName, 
                EMCT_MID_INIT = initial, 
                EMCT_PHONE_NUM = phoneNumber
                WHERE EMCT_EMP_ID = employeeID;
            END IF;
		END LOOP get_contact;
    CLOSE myCursor;
END ;;
